/**
 * Code generated using Python
 * @author Raja Reddy
 * Date : 17 Oct 2021
 *
 * Modified By : 
 */

import { useState, useEffect, useMemo } from 'react';
import Table, { SelectColumnFilter } from '../utils/Table'  // 
import axios from "axios";
import { format } from 'date-fns'
import { withRouter, Link } from "react-router-dom";
import TablePageAdj from '../utils/TablePageAdj';


function ViewRentMasterList() {

	const [data, setData] = useState([]);
	const [crData, setCrData] = useState([]);
	const [update, setUpdate] = useState(false);
	const [serverErrors, setServerErrors] = useState([]);
	const [search, setSearch] = useState("");
	const [inputText, setInputText] = useState('');
	const [page, setPage] = useState(0);
	//	const [pageSize, setPageSize] = useState(0);
	const [usrLevel, setUsrLevel] = useState(0);
	const [mesg, setMesg] = useState('');
	const [cdaoNo,setCdaoNo]=useState('');
	const [rentType,setRentType]=useState('');
	const [crDr,setCrDr]=useState('');


	useEffect(() => {
		let fetching = false;
		async function fetchData() {
			if (!fetching)

			await axios.get('/rents?search=' + search)

				.then((response) => {
					console.log(response.data);
					setData(response.data);


				})
				.catch((error) => {
					//console.log(error);
					//console.log(error.response.status);
					//console.log(error.response.headers);
					if (error.response)
						setServerErrors(error.response.data.error);
					else
						setServerErrors(error.Error);
				})
		}
		fetchData();
		return () => { fetching = true; }

	}, [update, search]);






	const columns = useMemo(() => [




		{
			Header: "Officer Details",
			accessor: "cdaoNo",


		},

		{
			Header: "Rent Details",
			accessor: "uabsoCode",

			Cell: ({ row }) => (
				<div>
					<div>
						<label>Uabso Code : {row.original.uabsoCode}</label>
					</div>
					<div>
						<label>Building No : {row.original.buildingNo}</label>
					</div>
					<div>
						<label>Station : {row.original.station}</label>
					</div>
					<div>
						{row.original.employee &&
							<label>Rank : {row.original.employee.rank.rankName}</label>
						}
					</div>
				</div>
			),
		},



		{
			Header: "Occupation Date",
			accessor: 'occupationDate',
			Cell: ({ row }) => (
				<div>
					<label>{row.original.occupationDate && format(new Date(row.original.occupationDate.toString()),'dd/MM/yyyy')}</label>
 				</div>
			),
		},

		{
			Header: "Vacation Date",
			accessor: 'vacationDate',
			Cell: ({ row }) => (
				<div>
					<label>{row.original.vacationDate && format(new Date(row.original.vacationDate.toString()),'dd/MM/yyyy')}</label>
				</div>
			),
		},

		{
			Header: "Rent Bill Details",
			accessor: "rentBillNo",

			Cell: ({ row }) => (
				<div>
					<div>
						<label>Reference Bill No : {row.original.referenceBillNo}</label>
